import React from 'react';


const Majorsfocusandstrategy = () => {
    return (
        <div className="container flex-container">
            <div className="row">
                <div className="col-md-1" />
                <div className="col-md-5">
                    <img id="shop-image" src="images/shop.png" alt='shop' />
                </div>
                <div className="col-md-5" id="shop-text" style={{ marginTop: "100px" }}>
                    <h2>Majors focus and strategy</h2>
                    <p>Majors focus and strategy<br /></p>
                </div>
                <div className="col-md-1" />
            </div>
        </div>
    )
}

export default Majorsfocusandstrategy;
